const DeviceMaxLedLimit = 80;

//Channel Name, Led Limit
let ChannelArray = [
	["Channel 1", 40],
	["Channel 2", 40],
	["Channel 3", 40],
	["Channel 4", 40],
];

function SetupChannels(){
	device.SetLedLimit(DeviceMaxLedLimit);

	for(let i = 0; i < ChannelArray.length; i++){
		device.addChannel(ChannelArray[i][0], ChannelArray[i][1]);
	}
}

function SetFanPollRate(seconds){
	// Smart Device v2 Seems to 'tick' 3 times per second.
	// This sets the device to report the fan speeds every 9 ticks, or 3 seconds
	let pollRate = Math.round(seconds * 3);

	let packet = [0x60, 0x02, 0x01, 0xe8, pollRate, 0x01, 0xe8, pollRate];
	device.write(packet, 64);
	device.read([0x00], 64);

	packet = [0x60, 0x03];
	device.write(packet, 64);
	device.read([0x00], 64);

}

let ConnectedFans = [];

function SetupFans(){
	if(device.fanControlDisabled()){
		return;
	}

	SetFanPollRate(3);

}

export function Initialize() {
	SetupChannels();

	RequestFirmware();

	SetupFans();

}

function RequestFirmware(){
	 let packet = [0x10, 0x01];
	 device.write(packet, 64);
}

export function Shutdown() {
	SendChannel(0, true);
	SendChannel(1, true);
	SendChannel(2, true);
	SendChannel(3, true);

}

function StreamLightingPacketChanneled(packetNumber, count, data, channel) {
	let packet = [];
	packet[0] = 0x22;
	packet[1] = 0x10 | packetNumber;
	packet[2] = 0x01 << channel;
	packet[3] = 0x00;
	packet = packet.concat(data);

	device.write(packet, 64);
}

function SubmitLightingColors(channel) {
	let packet = [];
	packet[0] = 0x22;
	packet[1] = 0xA0;
	packet[2] = 1 << channel;
	packet[3] = 0x00;
	packet[4] = 0x01;
	packet[5] = 0x00;
	packet[6] = 0x00;
	packet[7] = 0x28;
	packet[8] = 0x00;
	packet[9] = 0x00;
	packet[10] = 0x80;
	packet[11] = 0x00;
	packet[12] = 0x32;
	packet[13] = 0x00;
	packet[14] = 0x00;
	packet[15] = 0x01;
	device.write(packet, 64);
}

